drop database if exists reto4;

create database reto4;

use reto4;

CREATE TABLE Localidad (
    codigoPostal INT PRIMARY KEY,
    provincia VARCHAR(40) NOT NULL,
    ciudad VARCHAR(40) NOT NULL
);

CREATE TABLE Usuario (
    id INT PRIMARY KEY AUTO_INCREMENT,
    DNI CHAR(9) NOT NULL UNIQUE,
    login CHAR(10) NOT NULL UNIQUE,
    fechaRegistro DATE NOT NULL,
    ultimaSesion DATE NOT NULL,
    useradmin ENUM('si', 'no') NOT NULL,
    pass CHAR(6) NOT NULL,
    nombre VARCHAR(40) NOT NULL,
    apellido1 VARCHAR(40) NOT NULL,
    apellido2 VARCHAR(40),
    fechaNacimieto DATE NOT NULL,
    direccion VARCHAR(100) NOT NULL,
    codigoPostal INT NOT NULL,
    bloqueado ENUM ('si', 'no') DEFAULT 'no',
    CONSTRAINT FK_Cliente_codPostal FOREIGN KEY (codigoPostal)
        REFERENCES Localidad (codigoPostal),
    CONSTRAINT CHK_DNI_Restrin CHECK (DNI REGEXP '^[0-9]{8}[A-Z]$')
);

create table Libre(
	id int primary key,
	ultima_reproduccion datetime,
	constraint FK_Libre_codUser foreign key (id) references Usuario(id)
);

CREATE TABLE Premium (
    id INT PRIMARY KEY,
    numCuenta VARCHAR(16) NOT NULL,
    caduca VARCHAR(5) NOT NULL,
    cvv INT NOT NULL,
    CONSTRAINT FK_Premium_codUser FOREIGN KEY (id)
        REFERENCES Usuario (id),
    CONSTRAINT CHK_Premium_caduca CHECK (caduca LIKE '__/__'
        AND caduca REGEXP '^[0-9]{2}/[0-9]{2}$')
);

CREATE TABLE ListaReproduccion (
    id INT PRIMARY KEY AUTO_INCREMENT,
    numCanciones_Podcast INT NOT NULL,
    titulo VARCHAR(40) NOT NULL,
    codigoUsuario INT,
    CONSTRAINT FK_ListaReproduccion_codUser FOREIGN KEY (codigoUsuario)
        REFERENCES Usuario (id)
);

CREATE TABLE Audio (
    id INT PRIMARY KEY AUTO_INCREMENT,
    tituloAudio VARCHAR(100) NOT NULL,
    duracion TIME NOT NULL,
    numReproducciones INT NOT NULL
);

CREATE TABLE ListaRepAudio (
    codigoAudio INT,
    codigoLista INT,
    PRIMARY KEY (codigoAudio , codigoLista),
    CONSTRAINT FK_ListaRepAudio_codLista FOREIGN KEY (codigoLista)
        REFERENCES ListaReproduccion (id),
    CONSTRAINT FK_ListaRepAudio_codAudio FOREIGN KEY (codigoAudio)
        REFERENCES Audio (id)
);

CREATE TABLE Podcaster (
    id INT PRIMARY KEY AUTO_INCREMENT,
    nomPodcaster VARCHAR(40) NOT NULL,
    imagen MEDIUMBLOB,
    descripcion VARCHAR(100) NOT NULL,
    fechaUnion DATE NOT NULL
);

CREATE TABLE Serie (
    id INT PRIMARY KEY AUTO_INCREMENT,
    fechaInicio DATE NOT NULL,
    codigoPodcaster INT NOT NULL,
    tituloSerie VARCHAR(40) NOT NULL,
    tematica VARCHAR(40) NOT NULL,
    imagen MEDIUMBLOB,
    descripcion VARCHAR(5000) NOT NULL,
    CONSTRAINT FK_Serie_codPodcaster FOREIGN KEY (codigoPodcaster)
        REFERENCES Podcaster (id)
);

CREATE TABLE Grupo (
    id INT PRIMARY KEY AUTO_INCREMENT,
    fechaFormacion DATE NOT NULL,
    nomGrupo VARCHAR(40) NOT NULL,
    imagen MEDIUMBLOB,
    descripcion VARCHAR(100) NOT NULL
);

CREATE TABLE Disco (
    id INT PRIMARY KEY AUTO_INCREMENT,
    tituloDisco VARCHAR(40) NOT NULL,
    fechaPublicacion DATE NOT NULL,
    codigoGrupo INT,
    imagen MEDIUMBLOB,
    descripcion VARCHAR(100) NOT NULL,
    genero VARCHAR(40) NOT NULL,
    CONSTRAINT FK_Disco_codGrupo FOREIGN KEY (codigoGrupo)
        REFERENCES Grupo (id)
);

CREATE TABLE Canciones (
    id INT PRIMARY KEY,
    tituloCancion VARCHAR(40) NOT NULL,
    numReproducciones INT NOT NULL,
    codigoDisco INT,
    ruta VARCHAR(500) NOT NULL,
    CONSTRAINT FK_Canciones_codAudio FOREIGN KEY (id)
        REFERENCES Audio (id),
    CONSTRAINT FK_Canciones_codDisco FOREIGN KEY (codigoDisco)
        REFERENCES Disco (id)
);

CREATE TABLE Podcast (
    id INT PRIMARY KEY,
    tituloPodcast VARCHAR(100) NOT NULL,
    duracionMin INT,
    numReproducciones INT NOT NULL,
    codigoSerie INT NOT NULL,
    ruta VARCHAR(500) NOT NULL,
    CONSTRAINT FK_Podcast_codAudio FOREIGN KEY (id)
        REFERENCES Audio (id),
    CONSTRAINT FK_Podcast_codSerie FOREIGN KEY (codigoSerie)
        REFERENCES Serie (id)
);

